import logo from './logo.svg';
import './App.css';
import Topp,{a} from './component/Top';
import Text from './component/Text';
import { useState } from 'react';
function App() {
  const [mode, setmode] = useState('dark')
  function tooglemode(){
    setmode('dark');
  }
  return (
    <>
    {/* console.log({a}) */}
    <Topp title="Playing With English" mode={mode} togglemode={tooglemode}/>
    <Text title="Enter Text" mode={mode} togglemode={tooglemode}/>
    </>
  );
}

export default App;
